const Users = props => {

  const users = props.users.map((user, index) => {
    return <li key={index}>{user.username}</li>;
  });

  return (
    <div className="viewable">
    <h2>USERS</h2>
      <ul>
        {users}
      </ul>
    </div>
  );
};

export default Users;





